import React, { Component } from 'react';
import Geocode from "react-geocode";

Geocode.setApiKey("AIzaSyDTkNdUuexN_PZOKtezyqWdO-g3-ewhHiQ");
Geocode.setLanguage("en");
Geocode.enableDebug();
Geocode.fromLatLng("10.777919", "106.691867").then(
  response => {
    const address = response.results[0].formatted_address;
    console.log(address);
  },
  error => {
    console.error(error);
  }
);
Geocode.fromAddress("31 Võ Văn Tần, Phường 6, Quận 3", 'AIzaSyDTkNdUuexN_PZOKtezyqWdO-g3-ewhHiQ', 'en', 'Vietnam').then(
  res => {
    console.log(res);
  },
  err => {
    console.log(err);
  }
)

export default class GoogleMap extends Component {
  render() {
    return (
      <div>
        GoogleMap
      </div>
    )
  }
}
